public void init()
{
    InventDimCombination inventDimCombination;

    super();

    if(isConfigurationkeyEnabled(configurationKeyNum(Retail)))
    {
        Retail.visible(true);
    }

    if(!(select firstonly InventDimCombination).RecId)
    {
        inventDimCombination.ItemId = 'dummy';
        inventDimCombination.doInsert();
    }

    this.updateDesign();
}

public void updateDesign()
{
    Grid_FilterName.label("@SCL8");

    WebShopsTable_ds.object(fieldnum(SC_WebShopsTable, EnableRetailAssortments)).allowEdit(WebShopsTable.EnableRetail);
    WebShopsTable_ds.object(fieldnum(SC_WebShopsTable, RetailStore)).allowEdit(WebShopsTable.EnableRetail);
    WebShopsTable_ds.object(fieldnum(SC_WebShopsTable, RetailTerminalId)).allowEdit(WebShopsTable.EnableRetail);

    if(WebShopsTable.EnableB2BCustTemplate)
    {
        GeneralGroup_B2BregistrationType.visible(true);
        GeneralGroup_B2CregistrationType.label("@SCL443");
    }
    else
    {
        GeneralGroup_B2BregistrationType.visible(false);
        GeneralGroup_B2CregistrationType.label("@SCL639");
    }
}

public int active()
{
    int ret;

    ret = super();
    element.updateDesign();

    return ret;
}

public void lookup()
{
    ;
    switch(webshopsTable.OffsetLedgerAccountType)
    {
        case LedgerJournalACType::Bank:
            BankAccountTable::lookupBankAccount(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable.OffsetLedgerCompany);
            break;

        case LedgerJournalACType::Cust:
            CustTable::lookupCustomer(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable.OffsetLedgerCompany);
            break;

        case LedgerJournalACType::FixedAssets:
            AssetTable::lookupAccountNum(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable.OffsetLedgerCompany);
            break;

        case LedgerJournalACType::Project:
            ProjTable::lookupProjId(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable);
            break;

        case LedgerJournalACType::Vend:
            VendTable::lookupVendor(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable.OffsetLedgerCompany);
            break;

        case LedgerJournalACType::FixedAssets_RU:
            AssetTable::lookupAccountNum(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable.OffsetLedgerCompany);
            break;

        case LedgerJournalACType::RDeferrals:
            RDeferralsTable::lookupDeferrals(OffsetLedgerGroup_OffsetLedgerDimension, DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone()), webshopsTable.OffsetLedgerCompany);
            break;

        case LedgerJournalACType::RCash :
            RCashTable::lookupAccountNum(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable.OffsetLedgerCompany);
            break;
        case LedgerJournalACType::Employee_RU:
            EmployeeTable_RU::lookupAdvHolder(OffsetLedgerGroup_OffsetLedgerDimension, webshopsTable.OffsetLedgerCompany);
            break;

        default:
            super();
            break;
    }
}

public boolean checkUseCustomLookup(int _accountTypeEnumValue, int _secondaryAccountTypeEnumValue)
{
    boolean ret;

    ret = webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::Bank
       || webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::Cust
       || webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::FixedAssets
       || webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::Project
       || webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::Employee_RU
       || webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::RCash
       || webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::RDeferrals
       || webShopsTable.OffsetLedgerAccountType == LedgerJournalACType::Vend;

    return ret;
}
